Reading through the challenge guide, we see our node will receive echo messages that look something like that: { "src": "c1", "dest": "n1", "body": { "type": "echo", "msg_id": 1, "echo": "Please echo 35" }
} (If you want more details on the protocol Maelstrom uses to transmit messages, see this ) As explained above, the node_driver library provides you everything you need to model such messages. Therefore, before writing any Rust, we will start by reading the documentation of this library, and more particularly the documentation of the Message struct . This is our first encounter with a struct, the concept Rust uses to define aggregates of data. This is in a way very similar to C structs as you define your data and the behaviors to operate on it separately. Our data structure definition looks like this: pub struct Message<P> { pub src: String, pub dst: String, pub body: Body<P>,
} The pub keyword at the struct level denotes that this is a public structure exposed by the library to its callers, while the pub keywords before each field of the struct denotes these fields are accessible from outside of the struct, this can be though of as visibility modifiers. Of course, the documentation only shows public fields and structs since they are the only ones we can interact with. Each field is described as field_name: field_type. We see two basic fields src and dst, of type String. The last field type has a generic annotation (the <P> syntax, C++ users should feel pretty much at home here). It means that the Message struct is generic over a type, noted P, and here this type P is used in the definition of the type of the field body: a Body<P>. Let's look at the documentation for the type Body to understand what's going on here. The Body struct is documented like this: pub struct Body<P> { pub msg_id: Option<usize>, pub in_reply_to: Option<usize>, pub payload: P,
} There are two new things there: we see two fields that are of type Option<usize>, and the last field is of the type P, our generic type parameter. Let's explain each. Option<T> is another generic struct, in fact it comes from the Rust standard lib and is a staple of any Rust program, you can see the doc for this struct by clicking on it in the doc of the Body struct. This is actually an enum and not a struct, defined as: pub enum Option<T> { None, Some(T),
} (note that all enum fields have the visibility of the enum so no need to add pub to each variant here) So far this definition looks pretty similar to a classic Python enum, except, the second variant Some actually contains data, of type T (the generic parameter of the enum). This is what we call a sum type or an algebraic type: an enum that can contain different data types based on the variant. In our case, we use an Option<usize> which means that the data contained in the Some variant will be of type usize (a usize is an unsigned integer of the size of a pointer on your system, most likely 64 bits on a 64 bits system, for more details on basic scalar types, see this ), while the None variant contains nothing. Algebraic types are one of the killer features of Rust, for more details, refer to the official rust book . What's really important is that to get data out of your Option instance, you NEED to check if it's None or Some before, and the compiler will force you to do so. There is no way around this, and this prevents developers from accidentally forgetting that the result they deal with can be None. Python programmers will hopefully quickly realize how powerful this is, and how much safety it brings to the programs. Let's go back at our Body struct and look at the payload field. We see it is of type P, the type over which our struct is generic. This means that we can stuff any type we want as a payload of our message, a Message<f64> will have a field body of type Body<f64> which in turns will have a field payload of type f64.

