Armed with this knowledge, let's hop into our editor and start writing Rust to represent the echo messages. Open the file distributed_challenges/src/bin/echo.rs. You are faced with this: fn main() -> anyhow::Result<()> { todo!()
} This is a minimal Rust program, composed of a main function taking no arguments and returning a value of type anyhow::Result<()>. Let's not bother too much about this return type for now. The corpus of the function is a single invocation of the todo!() macro. Any function postfixed with a ! is what we call a macro. Let's not bother about this either, you can think of them as functions on steroids for now (If you want to know more, check out the rust book ). Let's define an enumeration to represent the payloads for the two messages our application will need to handle. Add this definition outside of the main function: /// Defines the payload we want to send to clients in the echo challenge
enum EchoPayload { /// Used by clients to send an echo request Echo { echo: String }, /// Used by nodes to respond to an echo request EchoOk { echo: String },
} We have two variants, one for each message, and each of them contains a string field called echo that will represent the data we are asked to echo back. (The /// defines docstring of the fields, while // are regular non-documenting comments) Let's make our enum a little bit easier to work with by adding some useful behaviors to it: Debug and Clone. The first one will allow us to print the enum content to debug it, and the second will make it so we can clone instances of the enum if we need to. In fact, these "behaviors" are what we call in Rust traits (see the official book on this). A trait defines functionality a particular type has and can share with other types. We can use traits to define shared behavior in an abstract way. This is in a way the interfaces of Rust, although it is much more powerful than this. The Debug and Clone traits are provided by the Rust standard library: https://doc.rust-lang.org/std/clone/trait.Clone.html and https://doc.rust-lang.org/std/fmt/trait.Debug.html . We could manually implement it for our type if we wanted to do fancy things, but the compiler is smart enough to infer basic implementations of these traits for us and all we have to do to get it is to add this line on top of our enum: /// Defines the payload we want to send to clients in the echo challenge
#[derive(Debug, Clone)]
enum EchoPayload { /// Used by clients to send an echo request Echo { echo: String }, /// Used by nodes to respond to an echo request EchoOk { echo: String },
} This tells the Rust compiler to generate an implementation of both the Clone and Debug traits for the EchoPayload enum, this is what we call "deriving traits". Here this work because Rust already ships a default implementation of these traits for all the types contained in our enumeration (String in this case).

