It's now time to code the logic to react to the messages we receive. First, we need to extract the message out of the Result<Message<EchoPayload>> returned by our iterator: fn main() -> anyhow::Result<()> { // init our node by getting its metadata and an output and input interface to communicate let (mut node_metadata, mut input, mut output) = Maelstrom::init()?; // main loop: for each message we receive through the input interface (with a payload of type EchoPayload) for msg in input.iter::<EchoPayload>() {} // if there was an error getting this message, propagate it (with the ? sigil) let msg = msg?; Ok(())
} Here we do a nice thing, we shadow the variable name msg by extracting the content or bubbling up any error using ?. After this line, the type of msg is no longer Result<Message<EchoPayload>> but Message<EchoPayload> which simplifies our code. Now, we will use a match statement to react differently to all the possible variants of the payload contained in the message: // main loop: for each message we receive through the input interface (with a payload of type EchoPayload) for msg in input.iter::<EchoPayload>() { // if there was an error getting this message, propagate it (with the ? sigil) let msg = msg?; // match on the type of payload within the message, these are variants of the EchoPayload enum match msg.body.payload { // if we get an Echo message, let's reply by crafting an EchoOk message and sending it through the output interface EchoPayload::Echo { echo } => todo!(), // we are not supposed to receive and EchoOk message, let's panic when it happens EchoPayload::EchoOk { .. } => panic!("EchoOk message shouldn't be received by a node"), }; } match statements are one of the killer features of Rust, they are really powerful, support pattern matching, and need to be exhaustive. Here we match on msg.body.payload which is of type EchoPayload, each arm of the match statement if of the form pattern => expression, or pattern => statement,. We use simple patterns here, one for each possible variant. In the first one, we use the pattern to deconstruct the echo field within the variant since we will need it to craft the response. In the second arm, we don't need it so we elide the deconstruction with the ... Finally, the second match arm is not supposed to happen in normal operations, so when it does we simply invoke the panic!() macro that will safely exit the program with an error message. Finally, let's complete the first match arm and send a response message: // ...
match msg.body.payload { EchoPayload::Echo { echo } => output.send_msg(Message { src: node_metadata.node_id.clone(), dst: msg.src, body: Body { msg_id: Some(node_metadata.get_next_msg_id()), in_reply_to: msg.body.msg_id, payload: EchoPayload::EchoOk { echo }, }, })?, /// ... This version is written concisely, but we could have made it a little clearer to new rustaceans by using a {} expression block here: match msg.body.payload { EchoPayload::Echo { echo } => { let response = Message { src: node_metadata.node_id.clone(), dst: msg.src, body: Body { msg_id: Some(node_metadata.get_next_msg_id()), in_reply_to: msg.body.msg_id, payload: EchoPayload::EchoOk { echo }, } }; output.send_msg(response)? }, /// ... We see that we instantiate a Message with an EchoOk payload, obtain a new message id from our NodeMetadata instance, and use our output interface to send it. You should end up with the following code: use node_driver::{Body, Maelstrom, Message};
use serde::{Deserialize, Serialize}; /// Defines the payload we want to send to clients in the echo challenge
#[derive(Debug, Clone, Serialize, Deserialize)]
#[serde(tag = "type")]
#[serde(rename_all = "snake_case")]
enum EchoPayload { /// Used by clients to send an echo request Echo { echo: String }, /// Used by nodes to respond to an echo request EchoOk { echo: String },
} fn main() -> anyhow::Result<()> { // init our node by getting its metadata and an output and input interface to communicate let (mut node_metadata, mut input, mut output) = Maelstrom::init()?; // main loop: for each message we receive through the input interface (with a payload of type EchoPayload) for msg in input.iter::<EchoPayload>() { // if there was an error getting this message, propagate it (with the ? sigil) let msg = msg?; // match on the type of payload within the message, these are variants of the EchoPayload enum match msg.body.payload { // if we get an Echo message, let's reply by crafting an EchoOk message and sending it through the output interface EchoPayload::Echo { echo } => output.send_msg(Message { src: node_metadata.node_id.clone(), dst: msg.src, body: Body { msg_id: Some(node_metadata.get_next_msg_id()), in_reply_to: msg.body.msg_id, payload: EchoPayload::EchoOk { echo }, }, })?, // we are not supposed to receive and EchoOk message, let's panic when it happens EchoPayload::EchoOk { .. } => panic!("EchoOk message shouldn't be received by a node"), }; } Ok(())
}

