Now that we have our definition of the message payloads, let's start writing the main loop logic. As in the previous part, we need to start by initializing our Maelstrom node (don't hesitate to look again at the documentation of the library at https://distributed-challenges.vercel.app/ ): fn main() -> anyhow::Result<()> { // init our node by getting its metadata and an output and input interface to communicate let (mut node_metadata, mut input, mut output) = Maelstrom::init()?;
} This gets us our input and output interfaces and the node metadata (that we also won't use much in this challenge). Let's start listening to incoming messages by looping on a blocking iterator on the messages received: fn main() -> anyhow::Result<()> { // init our node by getting its metadata and an output and input interface to communicate let (mut node_metadata, mut input, mut output) = Maelstrom::init()?; // main loop: for each message we receive through the input interface (with a payload of type UniqueIdPayload) for msg in input.iter::<UniqueIdPayload>() { // if there was an error getting this message, propagate it (with the ? sigil) let msg = msg?; todo!() }
} This time, we specify we want to receive messages with a payload of the type UniqueIdPayload that we just defined. We still have a line to propagate any error coming from the parsing/reception of the message. We can now match on this message and define how we want to react to each variants. We will again use a match statement to do so: // match on the type of payload within the message, these are variants of the UniqueIdPayload enum match msg.body.payload { // if we get a Generate message, let's reply by crafting an GenerateOk message and sending it through the output interface UniqueIdPayload::Generate => todo!(), // we are not supposed to receive a GenerateOk message, let's panic when it happens UniqueIdPayload::GenerateOk { .. } => { panic!("GenerateOk message shouldn't be received by a node") } }; We already know we are not supposed to receive any GenerateOk message, so let's panic with a clear error message when this happens. Keep in mind a panic is a controlled exit of the program, that should be used when we are faced with an unrecoverable error. One could argue we should just ignore the invalid message but panicking on it could help us catch errors if we were to implement our own clients. Let's no complete the match arm associated with the Generate message. We know we want to build a GenerateOk message with a new UUID and send it through our output interface: // match on the type of payload within the message, these are variants of the UniqueIdPayload enum match msg.body.payload { // if we get a Generate message, let's reply by crafting an GenerateOk message and sending it through the output interface UniqueIdPayload::Generate => output.send_msg(msg.to_response( Some(node_metadata.get_next_msg_id()), // obtain the next message id UniqueIdPayload::GenerateOk { // let's generate a uuid v4 using the uuid crate id: todo!(), }, ))?, // we are not supposed to receive a GenerateOk message, let's panic when it happens UniqueIdPayload::GenerateOk { .. } => { panic!("GenerateOk message shouldn't be received by a node") } };

