In this part we will need to learn how to do new stuff in Rust: writing multi-threaded code in particular so we will start from the content of the solution of the previous part and elaborate on it progressively while explaining everything. We will have 3 different actors (so 2 additional threads to the main thread): actor 1: run a timer and periodically ask for gossip to happen actor 2: read messages from input actor 3: consume the output of the previous two and run the main loop (i.e. send messages). Let's start by representing the messages our actors will send each others (we will call them Event to avoid confusion with the Message struct): /// This defines the possible events on which our main loop can react, within our actor system
enum Event { /// this event means there is no more input messages to read from Maelstrom Eof, /// this event means it's time to do some gossip TimeToGossip, /// this event means we have received a message MessageReceived(Message<BroadcastPayload>),
} As you can see, we use an enum with 3 variants. The first one will be used to mark the end of the input and properly shut down other threads. The second one will be emitted by our first actor at a periodic interval The third one encapsulates a Message and is sent by the actor that consumes from stdin. Essentially, we will have this architecture: ┌─────────┐ │ │
timer ──►│ actor 1 ├─┐ │ │ │ ┌─────────┐ └─────────┘ │ Channel<Event> │ │ ├───────────────►│ actor 3 ├──► stdout ┌─────────┐ │ │ │ │ │ │ └─────────┘
stdin ──►│ actor 2 ├─┘ │ │ └─────────┘ As you can see, we will use a channel to send and receive messages, we need a channel that allows multiple producers and single receiver (an MPSC channel in Rust lingua, Multiple Producers, Single Consumer). To declare such a channel, we need to write this code: // we will use an actor channel to handle scheduling of both gossiping and reading and
// responding to messages.
// create a channel that we will use to make our actors communicate
let (tx, rx) = std::sync::mpsc::channel::<Event>(); We can again observe the turbofish syntax used to specify which type of things we want to send through our channel. Sum types are such a natural fit to describe a message going through a channel: you have a single type, that can describe several variants, each carrying their own payload. When calling this channel function we get its two handles, tx (for transmit) to send events and rx (for receive) to receive events.

