Now we only need to write our actors. Let's start with actor 1, a thread that will loop and periodically send Event::TimeToGossip events in the channel. The code to do so looks like this use std::time::Duration;
// ... // clone the tx handle so that we keep one for the actor 2 as well
let tx_clone = tx.clone();
// spawn a thread generating periodic gossip events, our first actor
let gh = std::thread::spawn(move || loop { if tx_clone.send(Event::TimeToGossip).is_err() { // other side hung up, let's finish the loop break; }; std::thread::sleep(Duration::from_millis(250));
}); We can see here an example of a "closure", i.e. an anonymous function that can capture data from its invocation context. This is very similar to python lambdas. The syntax to declare a closure is [optional: move] |[args...]| [expression] Let's start with a simple example: let a: u8 = 23;
let closure = |b: u8| a + b; println!("The result is {}", closure(7)); This will print 30. This closure "captures" the a variable from its outer scope, and sums it with its parameter b. In the context of the closure, a would be a &u8 as closures capture variables by reference by default. If we want to capture outer variables by moving them into the closure scope instead of taking references, we prefix the closure syntax with the move keyword. In that case, a would be a u8 within the closure, and after invoking it, you could no longer use a in the outer scope as it would have been moved away (consumed by the closure if you want). Let's go back to our original closure that defines our thread: move || loop { if tx_clone.send(Event::TimeToGossip).is_err() { // other side hung up, let's finish the loop break; }; std::thread::sleep(Duration::from_millis(250));
} We use move because we cannot take references and send them to another thread (this is not memory safe and rust won't let you do it). We capture the tx_clone handle (by value because of the move modifier), and in an infinite loop (the loop keyword is syntactic sugar for while true), we send a Event::TimeToGossip event in the channel and then sleep the thread for 250ms. If the send call returns an error, we break out of the loop and therefore finish the thread. This will happen when the other side of the channel hangs up and we will use this mechanism to properly finish our threads and shutdown our application.

