Let's show the code for the second actor and then comment it: // spawn a thread forwarding input into the channel, our second actor
let ih = std::thread::spawn(move || { // get a new input interface, this can hang if another one already exists somewhere... let mut input = InputInterface::default(); for msg in input.iter::<BroadcastPayload>() { let msg = msg.expect("Should be able to get message from stdin"); if tx.send(Event::MessageReceived(msg)).is_err() { break; }; } // no more messages, send EOF for proper shutdown tx.send(Event::Eof).unwrap();
}); There is not much more going here but I'll detail a few points still: we don't clone tx once more, we directly captures the original tx into this thread since we won't need it anymore for other actors. once we have read all the messages from stdin, we send the special Event::Eof event in the channel to tell actor 3 that it's time to do shutdown. Once actor 3 shuts down, it will automatically signal actor 1 to shutdown as well by deleting the rx end of the channel. We need to acquire our mutable input interface within the thread scope. This is because an input interface is actually a mutex over stdin (to prevent several threads from accessing it simultaneously which would read garbage data), and a mutex cannot be sent safely to another thread. To make it work, we also need to change our Maelstrom init call to immediately drop the input handle we get from it and let this new thread acquire the lock itself. So you will need to change your init call to something like this: let (mut node_metadata, _, mut output) = Maelstrom::init()?; where _ is a special sigil which prevents the binding from happening and that automatically drops the returned value. at this point, your main function should look something like this: // ... imports ... fn main() -> anyhow::Result<()> { // init our node by getting its metadata and an output and input interface to communicate // here we drop the input interface as soon as we get it to release the lock before opening a // new one in a separate thread. let (mut node_metadata, _, mut output) = Maelstrom::init()?; // init the state let mut state = State { messages: HashSet::new(), topology: None, }; // we will use an actor channel to handle scheduling of both gossiping and reading and // responding to messages. // create a channel that we will use to make our actors communicate let (tx, rx) = std::sync::mpsc::channel::<Event>(); let tx_clone = tx.clone(); // spawn a thread generating periodic gossip events, our first actor let gh = std::thread::spawn(move || loop { if tx_clone.send(Event::TimeToGossip).is_err() { // other side hung up, let's finish the loop break; }; std::thread::sleep(Duration::from_millis(250)); }); // spawn a thread forwarding input into the channel, our second actor let ih = std::thread::spawn(move || { // get a new input interface, this can hang if another one already exists somewhere... let mut input = InputInterface::default(); for msg in input.iter::<BroadcastPayload>() { let msg = msg.expect("Should be able to get message from stdin"); if tx.send(Event::MessageReceived(msg)).is_err() { break; }; } // no more messages, send EOF for proper shutdown tx.send(Event::Eof).unwrap(); }); // we now need to write the third actor in the main thread todo!()
}

