Finally we will write our third actor that will simply consume events from the channel and react on them. On a gossip event, we will send messages to other nodes to let them know of the data we know. On a message event, we will respond to this message, possibly using the data we have in our state. Finally, on an eof event, we will simply stop the program properly. So let's start coding this by looping over the channel content and matching on the event type: // main loop: for each event we receive through the channel (our last actor)
for event in rx { match event { // match on the type of event received Event::Eof => { // rx is automatically dropped once we get out of the loop because we implicitly called // into_iter() on it to buils the loop, which consumes self. break; } Event::TimeToGossip => { // it's time to gossip, let's send messages to all nodes within our reach todo!() } Event::MessageReceived(msg) => { // match on the type of payload within the message, these are variants of the BroadcastPayload enum match &msg.body.payload { BroadcastPayload::Gossip { known } => { // we received a gossip message from another node, let's update our known data todo!() } BroadcastPayload::Topology { topology } => { state.topology = Some(topology.clone()); output.send_msg(msg.to_response( Some(node_metadata.get_next_msg_id()), BroadcastPayload::TopologyOk, ))? } // we are not supposed to receive a TopologyOk message, let's panic when it happens BroadcastPayload::TopologyOk => { panic!("TopologyOk message shouldn't be received by a node") } BroadcastPayload::Broadcast { message } => { state.messages.insert(*message); output.send_msg(msg.to_response( Some(node_metadata.get_next_msg_id()), BroadcastPayload::BroadcastOk, ))? } // we are not supposed to receive a BroadcastOk message, let's panic when it happens BroadcastPayload::BroadcastOk { .. } => { panic!("BroadcastOk message shouldn't be received by a node") } BroadcastPayload::Read => output.send_msg(msg.to_response( Some(node_metadata.get_next_msg_id()), BroadcastPayload::ReadOk { messages: state.messages.clone(), }, ))?, // we are not supposed to receive a ReadOk message, let's panic when it happens BroadcastPayload::ReadOk { .. } => { panic!("ReadOk message shouldn't be received by a node") } } } };
} // let's join on both threads for proper exit
ih.join().unwrap();
gh.join().unwrap(); In case of an Eof, we are just breaking out of the outer loop and then calling join() on both our thread handles to wait until they have complete and properly exit our program. In case of a message received, we do the same as we did in the previous part, except now this time we support a new payload type: BroadcastPayload::Gossip. This is a one shot message that don't expect a response, and that looks like this: /// Defines the payload we want to send to clients in the broadcast challenge
#[derive(Debug, Clone, Serialize, Deserialize)]
#[serde(tag = "type")]
#[serde(rename_all = "snake_case")]
enum BroadcastPayload { // ... snip ... // we will use this message to communicate gossip in-between nodes of the cluster Gossip { known: HashSet<usize>, },
} Now we just need to implement how to react on such a gossip message received, and how to react to a TimeToGossip event. For the latter we will just send a Gossip message with the messages we have stored in our state, and for the former we will update our state with the unknown messages we received: // ...
Event::TimeToGossip => { // it's time to gossip, let's send messages to all nodes within our reach if let Some(topology) = state.topology.as_ref() { for n in topology.get(&node_metadata.node_id).context(format!( "Node {} should appear in the topology", node_metadata.node_id ))? { // for now we send the full list of messages we know, which is suboptimal output.send_msg(Message { src: node_metadata.node_id.clone(), dst: n.clone(), body: Body { msg_id: None, in_reply_to: None, payload: BroadcastPayload::Gossip { known: state.messages.clone(), }, }, })?; } } // if we don't have the topology yet, let's skip gossiping for now.
}
// ... // ...
match &msg.body.payload { BroadcastPayload::Gossip { known } => { // we received a gossip message from another node, let's update our known data state.messages = state.messages.union(known).copied().collect(); }
// ...
} And that's all for this challenge, we implemented a complete actor model based on multithreading to act on several types of events coming from various sources in our program.
